import styles from './launchPanel.module.css';

export default function LaunchPanel({ launchData }) {
    return (
        <div className={styles.container}>
            {launchData.map(function(singleData) {
                return (
                    <div 
                        key={singleData.flight_number}
                        className={styles.card} >
                        <div className={styles.heroHeader}> {singleData.mission_name} #{singleData.flight_number} </div>
                        Launch Year: {singleData.launch_year}
                        Successful Launch: { singleData.launch_success !== null ? singleData.launch_success.toString() : 'Unknown'}
                        Successful Landing: { singleData.launch_success !== null ? singleData.launch_success.toString() : 'Unknown' }
                    </div>
                );
            })}
        </div>
    );
}
